import React, { useState, useEffect } from 'react';
import { Modal, Button, Descriptions, Tag, Timeline, Alert, Divider } from 'antd';
import { CheckCircleOutlined, ExclamationCircleOutlined } from '@ant-design/icons';
import { eventAPI } from '../services/api';
import moment from 'moment';

const DecisionModal = ({ decision, visible, onClose }) => {
  const [fullEvent, setFullEvent] = useState(null);
  const [loading, setLoading] = useState(false);
  const [relatedEvents, setRelatedEvents] = useState([]);

  useEffect(() => {
    if (decision && visible) {
      loadEventDetails();
    }
  }, [decision, visible]);

  const loadEventDetails = async () => {
    if (!decision) return;

    try {
      setLoading(true);
      const eventRes = await eventAPI.getEvent(decision.event_id);
      setFullEvent(eventRes.data);

      // Find related events (same day or topic)
      const allEventsRes = await eventAPI.getEvents({ limit: 200 });
      const related = allEventsRes.data.filter(event =>
        event.id !== decision.event_id &&
        (moment(event.timestamp).isSame(moment(decision.timestamp), 'day') ||
         event.topic.category === eventRes.data.topic.category)
      ).slice(0, 5);

      setRelatedEvents(related);
    } catch (error) {
      console.error('Failed to load event details:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleTracebackToConversation = () => {
    const traceInfo = `
Decision Traceback Analysis:

Event ID: ${decision.event_id}
Timestamp: ${moment(decision.timestamp).format('YYYY-MM-DD HH:mm:ss')}
Decision Maker: ${decision.actor.sender} (${decision.actor.role})
Priority Level: ${decision.priority}
Confidence: ${decision.confidence}

Rationale:
${decision.rationale || 'No specific rationale provided'}

Expected Outcome:
${decision.expected_outcome || 'No expected outcome specified'}

Full Context:
${decision.context}

Biomarkers Involved: ${decision.biomarkers?.join(', ') || 'None'}
Category: ${decision.category}

This decision can be traced back to the specific conversation thread for full context and accountability.
    `;
    
    alert(traceInfo);
  };

  const getPriorityIcon = (priority) => {
    switch(priority) {
      case 'High': return <ExclamationCircleOutlined style={{ color: '#ff4d4f' }} />;
      case 'Medium': return <CheckCircleOutlined style={{ color: '#faad14' }} />;
      default: return <CheckCircleOutlined style={{ color: '#52c41a' }} />;
    }
  };

  if (!decision) return null;

  return (
    <Modal
      title={
        <div>
          {getPriorityIcon(decision.priority)}
          <span style={{ marginLeft: 8 }}>Decision Analysis & Traceback</span>
        </div>
      }
      visible={visible}
      onCancel={onClose}
      width={900}
      footer={[
        <Button key="traceback" type="primary" onClick={handleTracebackToConversation}>
          View Full Conversation Context
        </Button>,
        <Button key="close" onClick={onClose}>
          Close
        </Button>
      ]}
    >
      <Alert
        message="Decision Accountability"
        description="This modal shows the complete rationale and context behind each healthcare decision, ensuring full transparency and traceability."
        type="info"
        showIcon
        style={{ marginBottom: 16 }}
      />

      <Descriptions bordered size="small" column={2}>
        <Descriptions.Item label="Decision Maker" span={1}>
          <Tag color="blue">{decision.actor.sender}</Tag>
          <span>({decision.actor.role})</span>
        </Descriptions.Item>
        <Descriptions.Item label="Timestamp" span={1}>
          {moment(decision.timestamp).format('YYYY-MM-DD HH:mm:ss')}
        </Descriptions.Item>
        <Descriptions.Item label="Priority Level" span={1}>
          <Tag color={decision.priority === 'High' ? 'red' : decision.priority === 'Medium' ? 'orange' : 'green'}>
            {decision.priority || 'Medium'}
          </Tag>
        </Descriptions.Item>
        <Descriptions.Item label="Confidence Level" span={1}>
          <Tag color="purple">{decision.confidence}</Tag>
        </Descriptions.Item>
        <Descriptions.Item label="Category" span={1}>
          <Tag color="cyan">{decision.category}</Tag>
        </Descriptions.Item>
        <Descriptions.Item label="Biomarkers" span={1}>
          {decision.biomarkers?.length > 0 ? (
            decision.biomarkers.map(marker => (
              <Tag key={marker} color="orange" style={{ margin: 2 }}>{marker}</Tag>
            ))
          ) : (
            <span style={{ color: '#999' }}>None specified</span>
          )}
        </Descriptions.Item>
      </Descriptions>

      <Divider orientation="left">Rationale & Expected Outcome</Divider>
      
      <div style={{ marginBottom: 16 }}>
        <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Decision Rationale:</div>
        <div style={{ 
          padding: 12, 
          backgroundColor: '#f6ffed', 
          border: '1px solid #b7eb8f', 
          borderRadius: 4 
        }}>
          {decision.rationale || 'No specific rationale provided'}
        </div>
      </div>

      <div style={{ marginBottom: 16 }}>
        <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Expected Outcome:</div>
        <div style={{ 
          padding: 12, 
          backgroundColor: '#e6f7ff', 
          border: '1px solid #91d5ff', 
          borderRadius: 4 
        }}>
          {decision.expected_outcome || 'No expected outcome specified'}
        </div>
      </div>

      <Divider orientation="left">Full Context</Divider>
      <div style={{ 
        padding: 12, 
        backgroundColor: '#fafafa', 
        borderRadius: 4, 
        maxHeight: 200, 
        overflowY: 'auto',
        marginBottom: 16
      }}>
        {decision.context}
      </div>

      {fullEvent && (
        <>
          <Divider orientation="left">Complete Event Information</Divider>
          <Descriptions size="small" column={2}>
            <Descriptions.Item label="Event Type" span={1}>
              {fullEvent.topic.category} - {fullEvent.topic.subtype}
            </Descriptions.Item>
            <Descriptions.Item label="Location Context" span={1}>
              {fullEvent.travel.flag ? `${fullEvent.travel.region} - ${fullEvent.travel.location}` : 'Home'}
            </Descriptions.Item>
            {fullEvent.metrics.adherence_pct && (
              <Descriptions.Item label="Adherence" span={1}>
                <Tag color={fullEvent.metrics.adherence_pct > 70 ? 'green' : 'orange'}>
                  {fullEvent.metrics.adherence_pct}%
                </Tag>
              </Descriptions.Item>
            )}
            {fullEvent.metrics.sleep_hours && (
              <Descriptions.Item label="Sleep Context" span={1}>
                {fullEvent.metrics.sleep_hours} hours
              </Descriptions.Item>
            )}
          </Descriptions>
        </>
      )}

      {relatedEvents.length > 0 && (
        <>
          <Divider orientation="left">Related Events (Same Day/Topic)</Divider>
          <Timeline size="small">
            {relatedEvents.map(event => (
              <Timeline.Item key={event.id}>
                <div style={{ fontWeight: 'bold' }}>
                  {event.actor.sender} - {moment(event.timestamp).format('HH:mm')}
                </div>
                <div style={{ fontSize: '12px', color: '#666' }}>
                  {event.content.summary.slice(0, 1).join(' ')}
                </div>
              </Timeline.Item>
            ))}
          </Timeline>
        </>
      )}
    </Modal>
  );
};

export default DecisionModal;
